// src/icons.js

import { ReactComponent as AllTasksIcon } from './assets/icons/all_tasks.svg';
import { ReactComponent as AnyTimeIcon } from './assets/icons/any_time.svg';
import { ReactComponent as AssignedDateIcon } from './assets/icons/assigned_date.svg';
import { ReactComponent as DeleteIcon } from './assets/icons/delete.svg';
import { ReactComponent as PersonalIcon } from './assets/icons/personal.svg';
