import { ReactComponent as PlannedIcon } from './assets/icons/planned.svg';
import { ReactComponent as ShareLinkIcon } from './assets/icons/share_link.svg';
import { ReactComponent as SignOutIcon } from './assets/icons/sign_out.svg';
import { ReactComponent as TextLogoIcon } from './assets/icons/text_logo.svg';
import { ReactComponent as TodayIcon } from './assets/icons/today.svg';
import { ReactComponent as WorkIcon } from './assets/icons/work.svg';
