import { ReactComponent as BookIcon } from './assets/icons/book.svg';
import { ReactComponent as LinkSelectedIcon } from './assets/icons/link-selected.svg';
import { ReactComponent as EditSelectedIcon } from './assets/icons/edit-selected.svg';

import { ReactComponent as BookLightIcon } from './assets/icons/book-light.svg';
import { ReactComponent as SparkleLightIcon } from './assets/icons/sparkle_light.svg';
import { ReactComponent as WorkLightIcon } from './assets/icons/work_light.svg';
import { ReactComponent as PersonalLightIcon } from './assets/icons/personal_light.svg';
import { ReactComponent as AnyTimeLightIcon } from './assets/icons/any_time_light.svg';
import { ReactComponent as AllTasksLightIcon } from './assets/icons/all_tasks_light.svg';
import { ReactComponent as PlannedLightIcon } from './assets/icons/planned_light.svg';
import { ReactComponent as TodayLightIcon } from './assets/icons/today_light.svg';
import { ReactComponent as CustomCategoryIcon } from './assets/icons/custom_category.svg'; // Beispiel-Pfad

export {
  AllTasksIcon,
  AnyTimeIcon,
  AssignedDateIcon,
  DeleteIcon,
  PersonalIcon,
  PlanTaskIcon,
  PlannedIcon,
  ShareLinkIcon,
  SignOutIcon,
  TextLogoIcon,
  TodayIcon,
  WorkIcon,
  AddTodoIcon,
  AddIcon,
  SparkleIcon,
  XIcon,
  EditIcon,
  LinkIcon,
  BookIcon,
  LinkSelectedIcon,
  EditSelectedIcon,
  BookLightIcon,
  PlanTaskGreyIcon,
  SparkleLightIcon,
  WorkLightIcon,
  PersonalLightIcon,
  AnyTimeLightIcon,
  AllTasksLightIcon,
  PlannedLightIcon,
  TodayLightIcon
};

export const  iconMap = {
  'All Tasks': AllTasksIcon,
  'Today': TodayIcon,
  'Planned': PlannedIcon,
  'Any Time': AnyTimeIcon,
  'Work': WorkIcon,
  'Personal': PersonalIcon,
  'Logbook': BookIcon,
};

export const customCategoryIcon = SparkleIcon;
